import React from 'react';
import axios from 'axios';



export default class Scrape extends React.Component {

    state={imgVdData:[null]}

    componentDidMount() {

        let url = "http://localhost:3000/scrape";
        let token = 'dGVzdDp0ZXN0MTIz';

        axios({ method: 'get', url: 'your URL', headers: { Authorization: `Bearer ${token}` } })

      axios.get(`http://localhost:3000/scrape`,{
        headers: {
            'Authorization': `Basic dGVzdDp0ZXN0MTIz`,
          }})
        .then(res => {
          const imgVdData = res.data;
          this.setState({ imgVdData:imgVdData });
        }).catch((e)=>{
            console.log(e);
            this.setState({ imgVdData:e });
        });
    }

    render() {
      return (
        <ul>
          { this.state.imgVdData.map(data => <li>{data}</li>)}
        </ul>
      )
    }
  }
